import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Scorebutton(props) {
  return(
    <select className="scorebutton">
      <option value="1">1</option>
      <option value="2">2</option>
      <option value="3">3</option>
      <option value="4">4</option>
      <option value="5">5</option>
      <option value="6">6</option>
      <option value="7">7</option>
      <option value="8">8</option>
      <option value="9">9</option>
      <option value="10">10</option>
    </select>
  );
}


class Player extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return(
      <div>
         <h3>{this.props.playername}</h3>
         <Scorebutton/>
      </div>
    );
  }
}

class HoleScreen extends React.Component {
  constructor(props) {
    super(props);
  }


  submitScore() {
    alert('click');
  }
  render() {
    return(
      <div>
        <div>
          <h2>Hole {this.props.holenum}</h2>
          <h4>Par {this.props.holepar}</h4>
          <Player playername="Pearl"/>
          <Player playername="Todd"/>
          <Player playername="Jenny"/>
        </div>
        <br/>
        <div>
          <button onClick={() => this.submitScore()}>Next Hole</button>
        </div>
      </div>
    );
  }
}
ReactDOM.render(
   <HoleScreen holenum="1" holepar="3"/>,
   document.getElementById('root')
);
